import React, { Component } from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Route,
  Switch
} from 'react-router-dom';
//import style
import './images/icons/favicon.png';
import './href="vendor/bootstrap/css/bootstrap.min.css';
import './fonts/font-awesome-4.7.0/css/font-awesome.min.css';
import './fonts/themify/themify-icons.css';
import './fonts/Linearicons-Free-v1.0.0/icon-font.min.css';
import './fonts/elegant-font/html-css/style.css';
import './vendor/animate/animate.css';
import './vendor/css-hamburgers/hamburgers.min.css';
import './vendor/animsition/css/animsition.min.css';
import './vendor/select2/select2.min.css';
import './vendor/daterangepicker/daterangepicker.css';
import './vendor/slick/slick.css';
import './vendor/lightbox2/css/lightbox.min.css';
import './css/util.css';
import './css/main.css';


import NavBar from './components/NavBar';
import Product from './components/Product';
import Home from './components/Home';
import About from './components/About';
import Contact from './components/Contact';






class App extends Component {
  render() {
    return (
      <Router>
        <div>
          <NavBar />

          <Switch>
            <Route exact path='/' component={Home} />
            <Route path='/about' component={About} />
            <Route path='/contact' component={Contact} />
            <Route path='/product/:category' component={Product} />
            <Route path='/product' component={Product} />

          </Switch>
        </div>
      </Router>
    );
  }
}

export default App;
